import React, { Component } from "react"

class App extends Component {
    constructor() {
        super()
        this.state = {
            individual: {}

        }
    }
    componentDidMount() {
        this.setState()
        fetch("https://raw.githubusercontent.com/VSchool/vschool-api/master/static/hitlist.json")
            .then(response => response.json())
            .then(data => console.log(data))


    }

    render() {
        <div></div>
    }

}

export default App
